													<p>Keluarga &amp; Sahabat,</p>
													<p>Tidak ada yang spesial dalam cerita kami.<br />
														Tapi kami sangat spesial untuk satu sama lain.<br />
														Awal pertama kali kami bertemu di salah satu perusahaa BUMN hanya sebagai rekan kerja, dan saling bercerita satu sama lain kemudiaan tanggal 28 Maret 2018 Kami mulai dekat.</p>
													<p>Butuh waktu yang amat panjang untuk saling menemukan.<br />
														Butuh banyak cerita dan pengalaman kami lewati sebelum akhirnya saling bertemu dan memutuskan.</p>
													<p>15 November 2020<br />
														Acara lamaran kami berlangsung, petualangan baru menuju pernikahanpun dimulai.</p>
													<p>Kami bersyukur, dipertemukan Allah diwaktu terbaik, Kini kami menanti hari istimewa kami.<br />
														Hari yang tak lelah kami pintakan dalam doa pada-Nya.</p>
													<p>Di tahun 2020 yang sangat spesial<br />
														ini, Momen spesial kami akan dimulai dari titik ini, momen kebahagiaan kami bersama membangun keluarga kecil kami. Semoga Allah SWT memberikan keberkahan untuk pernikahan kami amin.</p>
													<p>Kebahagiaan di hari yang sakral ini, tentunya tak akan lengkap tanpa doa dan restu dari sahabat dan keluarga.</p>
